import "./Main.css";
import { useState } from "react";
import AfterPatientLoginBlock from "./Main/Login_Reg/AfterLogin/AfterPatientLogin/AfterPatientLoginBlock";
import Main2 from "./Main2";

const Main = () => {
  const isDocLog = localStorage.getItem("Doctor Log");
  const isPatLog = localStorage.getItem("Patient Log");
  const [redirect , setRedirect] = useState();
  if(isPatLog === "true")
  {
    setRedirect(<AfterPatientLoginBlock/>)
  }
  else if (isPatLog !== null){
    setRedirect(<Main2/>)
  }
  return(
    <>
     {redirect}
    </>
  );
}  


export default Main;
